import React, { useState } from 'react';

const Card = ({ ListData, item }) => {
    const [list, setList] = useState(item)
    const styles = {
        float: 'left',
        width: 'calc(50% - 20px)',
        height: '100px',
        margin: '5px',
        border: '1px solid red',
    }
    const imageArea = {
        display: 'block',
        width: '100px',
        height: '100px',
        backgroundSize: '100px'
    }
    const fontStyle = {
        fontSize: 20,
    }


    return(
        <div style={styles}>
            <span style={{imageArea}}></span>
            <span>{list.brandName}</span>
            <span>{list.content}</span>
            <span>{list.majorCategoryName}</span>
        </div>  
    );
}

export default Card;
